// src/App.jsx
import React, { useState } from 'react';
import { Tab, Tabs, Container, Paper } from '@mui/material';
import FormComp from './components/FormComponent';
import DataComp from './components/DataComponent';

const App = () => {
  const [tabIndex, setTabIndex] = useState(0);
  const [userData, setUserData] = useState(null);

  const handleFormSubmit = (formData) => {
    // For testing purposes, use fake data until the backend connection is established
    const fakeUserData = {
      username: 'JohnDoe',
      phoneNumber: '1234567890',
      password: 'TestPassword',
      confirmPassword: 'TestPassword',
    };

    // Save data to state
    setUserData(fakeUserData);
    setTabIndex(1); // Switch to the second tab after submitting the form
  };

  return (
    <Container component="main" maxWidth="xs">
      <Paper elevation={3} style={{ padding: '20px', marginTop: '20px' }}>
        <Tabs value={tabIndex} onChange={(e, index) => setTabIndex(index)}>
          <Tab label="Form" />
          <Tab label="Data" />
        </Tabs>
        {tabIndex === 0 && <FormComp onSubmit={handleFormSubmit} />}
        {tabIndex === 1 && <DataComp userData={userData} />}
      </Paper>
    </Container>
  );
};

export default App;
